      "desc": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Sleep plays a crucial role in your health and overall happiness. During sleep, your brain is building new pathways, while your muscles and tissues are recovering. Sleep also helps you maintain a healthy immune system, regulating the hormones that make you feel hungry. Adults should sleep 7-8 hours every night. Lack of sleep can affect both mental and physical health, so prioritize giving yourself the gift of restorative sleep each night."])}
