  "kyhua": {
    "0": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["As your body uses the oxygen it needs, it produces harmful chemicals called free radicals, which can then attack the chemicals in your body cells. Unchecked, free radicals can have catastrophic effects on a number of serious health conditions, including cancer, heart disease, Alzheimer’s, and diabetes."])},
    "1": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Fortunately, your body’s defense system is adept at fighting back against free-radical attacks and producing protective antioxidants to prevent harm. However, prolonged exposure, alcohol consumption, and stress can accelerate the production of free radicals – our bodies work hard to produce enough antioxidants to adequately protect us. This means that we need to increase our intake of antioxidants to avoid serious health problems."])},
    "2": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Where can I find antioxidants? The three main antioxidant vitamins are beta-carotene, vitamin C, and vitamin E, and they can be found in particular in fruits and vegetables. Obtaining sufficient antioxidants is therefore an important issue for good nutrition."])},
    "3": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Brightly colored vegetables and fruits like carrots, spinach, and tomatoes are rich in beta-carotene and vitamin C, which can neutralize them before they cause any damage from free radicals. They can also strengthen your cell defenses and enhance your immune system, reducing the risk of diseases."])},
    "4": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Berries like raspberries, strawberries, and blueberries, whether fresh, dried, or frozen, are rich in flavonoid antioxidants and vitamin C, which can improve your cell defenses and boost your immune system."])},
    "5": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Nuts are high in vitamin E antioxidants, with walnuts, pecans, and chestnuts being richest in antioxidants. They can reduce the risk of cancer and have potential antiviral, antibacterial, and antiparasitic effects."])},
    "6": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Dark chocolate. Chocolate's cocoa content provides plenty of antioxidants, so choose the darkest, richest chocolate you can find to reap the most health benefits."])},
    "7": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Red wine is made from red and purple grapes, which contain a wealth of catechin antioxidants. A glass of red wine can not only lower cholesterol, but also protect the blood vessels in your heart and prevent blood clots."])},
    "8": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Even if you choose a diet rich in antioxidants, you may not be able to consume as many antioxidants as you imagine. Cooking vegetables can reduce their nutritional value, so try to lightly steam or eat them raw. Fruits or vegetables should be left unpeeled as much as possible - buying organic food can make this process easier. Avoid chopping or soaking fruits and vegetables, as this will also remove some of their essence."])},
    "9": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["What supplements can I take? To help you get enough antioxidants, why not take a daily multivitamin supplement? Look for high-quality products containing antioxidant ingredients that can enhance the protection you get from your diet – after all, that's why they're called supplements."])},
    "10": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["What else can I do to maximize my intake of antioxidants? Free radicals thrive under stress, so try to manage or limit situations that generate stress. When under stress, find ways to calm yourself down and ensure you get adequate sleep. Free radicals also multiply faster when you are exposed to sunlight for long periods of time, so cover your body as much as possible and stay in the shade. Alcohol and smoking can accelerate the production of free radicals, so reducing or quitting is necessary to maintain health."])},
    "11": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["For good health and longevity, antioxidants are essential, and obtaining sufficient antioxidants means choosing a nutritious and diverse diet and adopting healthy lifestyles. Eating more fruits and vegetables every day and improving your overall lifestyle/habits can basically save your life."])}
  },
