    "title": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["How should children supplement nutrition? Different age groups require different methods of supplementation"])},
    "header": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Children's growth and development process has different fast and slow stages, but these stages are interrelated and tightly connected. Any developmental obstacles in one stage will have adverse effects on the next stage. Therefore, high-quality and balanced nutrition is needed at any stage of growth and development, which is beneficial for children's healthy growth."])},
    "subTitle": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["So, how can children of different ages supplement nutrition to stay healthy?"])},
    "footer": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["In summary, the ways and types of food that children need to supplement nutrition vary according to different stages of growth and development. Parents need to supplement nutrition according to their children's different stages of growth and development, which is beneficial for their children's healthy growth."])},
