      "desc": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Schlaf spielt eine entscheidende Rolle für Ihre Gesundheit und allgemeine Glückseligkeit. Während des Schlafs entsteht im Gehirn neue Pathways und Ihre Muskeln und Gewebe regenerieren sich. Schlaf hilft auch, Ihr Immunsystem gesund zu halten und Hormone zu regulieren, die Hunger verursachen.\n      Erwachsene sollten jede Nacht 7 bis 8 Stunden schlafen. Schlafmangel kann sich auf die geistige und körperliche Gesundheit auswirken, daher ist es wichtig, sich jede Nacht mit einem erholsamen Schlaf zu belohnen."])}
