  "kyhua": {
    "0": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Wenn Ihr Körper Sauerstoff verbraucht, entstehen schädliche Chemikalien, die als freie Radikale bezeichnet werden und chemische Substanzen sind, die Ihre Zellen angreifen können. Da freie Radikale mit schwerwiegenden Gesundheitsproblemen wie Krebs, Herzerkrankungen, Alzheimer und Diabetes zusammenhängen, können unkontrollierte freie Radikale katastrophale Auswirkungen haben."])},
    "1": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Glücklicherweise ist Ihr Körpers Abwehrsystem sehr gut darin, sich gegen Angriffe freier Radikale zu verteidigen, indem es antioxidative Schutzstoffe produziert und Schäden verhindert. Aber langes Sonnenbaden, Trinken und Stress können die Bildung von freien Radikalen beschleunigen - unser Körper kann hart arbeiten, um genug Antioxidantien zu produzieren, um uns angemessen zu schützen. Das bedeutet, dass wir unsere Aufnahme von Antioxidantien erhöhen müssen, um schwerwiegende Gesundheitsprobleme zu vermeiden."])},
    "2": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Wo finde ich Antioxidantien? Die drei wichtigsten Antioxidantien-Vitamine sind β-Carotin, Vitamin C und Vitamin E, die insbesondere in Obst und Gemüse zu finden sind. Eine ausgewogene Ernährung mit ausreichend Antioxidantien ist daher ein sehr wichtiges Anliegen."])},
    "3": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Bunt gefärbtes Gemüse und Obst wie Karotten, Spinat und Tomaten enthalten viel β-Carotin und Vitamin C und können sie neutralisieren, bevor sie Schaden anrichten. Sie können auch die Abwehrkräfte Ihrer Zellen stärken und das Immunsystem verbessern, um das Risiko von Krankheiten zu verringern."])},
    "4": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Beeren wie Himbeeren, Erdbeeren und Blaubeeren, ob frisch, getrocknet oder gefroren, sind reich an Flavonoid-Antioxidantien und Vitamin C und können die Abwehrkräfte Ihrer Zellen und Ihr Immunsystem verbessern."])},
    "5": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Nüsse enthalten viel Vitamin-E-Antioxidans, und Walnüsse, Pekannüsse und Kastanien enthalten die reichsten Antioxidantien. Sie können das Krebsrisiko reduzieren und potenzielle antivirale, antibakterielle und antiparasitäre Wirkungen haben."])},
    "6": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Dunkle Schokolade. Der Gehalt an Kakaobohnen in Schokolade enthält viele Antioxidantien. Wählen Sie also die dunkelste und stärkste Schokolade aus, die Sie finden können, um maximalen gesundheitlichen Nutzen zu erzielen."])},
    "7": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Rotwein wird aus roten und violetten Trauben hergestellt und enthält reichlich Catechin-Antioxidantien. Ein Glas Rotwein kann nicht nur den Cholesterinspiegel senken, sondern auch die Blutgefäße im Herzen schützen und Blutgerinnsel verhindern."])},
    "8": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Auch wenn Sie eine Ernährung wählen, die reich an Antioxidantien ist, nehmen Sie möglicherweise nicht so viele Antioxidantien auf, wie Sie denken. Das Kochen von Gemüse kann ihren Nährwert verringern, daher sollten Sie sie so leicht wie möglich dämpfen oder roh essen. Obst oder Gemüse sollten möglichst nicht geschält werden - der Kauf von Bio-Lebensmitteln macht dies viel einfacher. Vermeiden Sie das Schneiden oder Einweichen von Obst und Gemüse, da dadurch auch einige wertvolle Nährstoffe entfernt werden können."])},
    "9": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Welche Ergänzungen kann ich einnehmen? Warum nehmen Sie nicht jeden Tag ein multivitaminhaltiges Nahrungsergänzungsmittel ein, um Ihnen bei der ausreichenden Aufnahme von Antioxidantien zu helfen? Suchen Sie nach hochwertigen Produkten, die Antioxidantien enthalten (können den Schutz verbessern, den Sie aus Ihrer Ernährung erhalten haben) - schließlich sind das die Gründe, warum sie als Ergänzungen bezeichnet werden."])},
    "10": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Was kann ich noch tun, um die Aufnahme von Antioxidantien maximal zu erhöhen? Freie Radikale können unter Stress gedeihen, daher sollten Sie versuchen, stressige Situationen zu bewältigen oder zu begrenzen. Versuchen Sie, ruhig zu bleiben und stellen Sie sicher, dass Sie ausreichend schlafen, wenn Sie unter Stress stehen. Wenn Sie lange Zeit in der Sonne sind, vermehren sich freie Radikale ebenfalls schnell, daher sollten Sie Ihren Körper so gut wie möglich bedecken und im Schatten bleiben. Alkohol und Rauchen können die Bildung von freien Radikalen beschleunigen, daher müssen sie reduziert oder aufgegeben werden, um Ihre Gesundheit zu erhalten."])},
    "11": (ctx) => {const { normalize: _normalize } = ctx;return _normalize(["Antioxidantien sind für eine gesunde Lebenserwartung unerlässlich, und eine ausgewogene Ernährung mit ausreichend Antioxidantien und ein gesunder Lebensstil sind der Schlüssel dazu. Wenn Sie jeden Tag mehr Obst und Gemüse essen und Ihre allgemeine Lebensweise / Gewohnheiten verbessern, können Sie im Grunde genommen Ihr Leben retten. "])}
  },
